import { Link } from "react-router-dom";

/* eslint-disable import/no-anonymous-default-export */
export default() => {
    return(

        <div className="formuario">
             <form className="row g-3" stylo="boder:1px;">
   <div className="col-auto">
     <label for="cpf" className="visually-hidden">CPF</label>
     <Link type="cpf" className="form-control" id="cpf" placeholder="Digite seu CPF"></Link>
   </div>
 </form>
 </div>

    );
}
